import React from "react";
import { Routes, Route } from "react-router-dom";
import Topbar from "../../component/Topbar";
import Sidebar from "../../component/Sidebar";
import About from "../../component/About";
import Lokasi from "../../component/Lokasi";
import Aktivity from "../../component/Aktivity";
import AkunBank from "../../component/AkunBank";
import "./app.css";
import ShareIcon from '@mui/icons-material/Share';
import { LocationCityOutlined } from "@material-ui/icons";

function App() {
  return (
    <div className="App">
      <div class="row">
        <div class="col-sm-2 flex">
          <Sidebar />
        </div>
        <div class="col-sm-10 flex1 hijau">
          <Topbar />
            <div class="row margin-top margin-left">
              <About/>
              <div class="col-sm-8">
                <Lokasi/>
                <div class="row">
                  <div class="col margin-top">
                    <div class="card-deck">
                      <div class="card">
                        <div class="card-body">
                          <div class="card-deck">
                            <div clas="row">
                              <AkunBank/>
                              <Relasi/>

                            </div>

                          </div>
                        </div>
                      </div>

                      <Aktivity/>

                    </div>
                  </div>

                </div>
              </div>
            </div>
        </div>
      </div>
    </div>
  );
}

export default App;
